        <section className="welcome h-2/3">
            <div className="devil-start bg-center flex  flex-col">
                <p className="text-opacity-70 uppercase text-center block z-20 text-gray-100 font-thin text-4xl md:text-8xl">Introduce you niggas to the new swag</p>
            </div>
        </section>
    )
}
